namespace GTA5Core.GTA.Vehicles;

public static class VehicleHash
{
    static VehicleHash()
    {
        // 填充全部载具
        foreach (var vClass in VehicleClasses)
        {
            foreach (var info in vClass.VehicleInfos)
            {
                info.Value = info.Value.ToLower();
                info.Class = vClass.Name;
                info.Hash = GTAHelper.JOAAT(info.Value);
                info.Image = GTAHelper.GetVehicleImage(info.Value);

                AllVehicles.Add(info);
            }
        }
    }

